&nbsp;

<strong>Long Beach</strong> is a city in <a href="https://en.wikipedia.org/wiki/Los_Angeles_County,_California">Los Angeles County</a> in <a href="https://en.wikipedia.org/wiki/Southern_California">Southern California</a>, on the <a href="https://en.wikipedia.org/wiki/Pacific_Ocean">Pacific</a> coast of the United States. The city is the <a href="https://en.wikipedia.org/wiki/List_of_United_States_cities_by_population">36th-largest</a> city in the <a href="https://en.wikipedia.org/wiki/United_States">United States</a> and the <a href="https://en.wikipedia.org/wiki/List_of_cities_in_California_(by_population)">seventh-largest</a> in <a href="https://en.wikipedia.org/wiki/California">California</a>. As of 2010, its population was 462,257.<sup><a href="https://en.wikipedia.org/wiki/Long_Beach,_California#cite_note-census.gov-14">[14]</a></sup> In addition, Long Beach is the second largest city in the <a href="https://en.wikipedia.org/wiki/Greater_Los_Angeles_Area">Greater Los Angeles Area</a> (after <a href="https://en.wikipedia.org/wiki/Los_Angeles">Los Angeles</a>) and a principal city of the <a href="https://en.wikipedia.org/wiki/Los_Angeles-Long_Beach-Anaheim,_CA_Metropolitan_Statistical_Area">Los Angeles-Long Beach-Anaheim, CA Metropolitan Statistical Area</a>

